import React, { Fragment, useEffect } from 'react';
import PropTypes from 'prop-types';
import { connect } from 'react-redux';
import { getCurrentOwnerVehicle } from '../../actions/OwnerProfile';
import Spinner from '../layout/spinner';
import { Link } from 'react-router-dom';
import ProfileTop from './ProfileTop';

const CurrentOwnerVehicle = ({
  getCurrentOwnerVehicle,
  profile: { profile, loading },
  auth,
  match
}) => {
  useEffect(() => {
    getCurrentOwnerVehicle(match.params.id);
  }, [getCurrentOwnerVehicle, match.params.id]);

  return (
    <Fragment>
      {profile === null || loading ? (
        <Spinner />
      ) : (
        <Fragment>
          <Link to='/owners' className='btn btn-light'>
            Back To Owners
          </Link>
          <div class='profile-grid my-1'>
            <ProfileTop profile={profile} />
          </div>
        </Fragment>
      )}
    </Fragment>
  );
};
CurrentOwnerVehicle.propTypes = {
  getCurrentOwnerVehicle: PropTypes.func.isRequired,
  profile: PropTypes.object.isRequired,
  auth: PropTypes.object.isRequired
};

const mapStateToProps = state => ({
  profile: state.profile,
  auth: state.auth
});

export default connect(mapStateToProps, { getCurrentOwnerVehicle })(
  CurrentOwnerVehicle
);
